function searchUser() {
    let q = document.getElementById("search").value.trim();
    let box = document.getElementById("results");
    box.innerHTML = "";
    let numQ = Number(q);
    let found = users.filter(u => (!isNaN(numQ) && u.id == numQ) || u.phone.includes(q));
    if (!found.length) {
        box.innerHTML = "<p>–ù–∏—á–µ–≥–æ –Ω–µ –Ω–∞–π–¥–µ–Ω–æ</p>";
        return;
    }
    found.forEach(u => {
        let div = document.createElement("div");
        div.className = "user";
        div.innerHTML = "<b>" + u.name + "</b><br>" + u.phone;
        div.onclick = function() {
            map.setView([u.lat, u.lon], 15);
            L.popup()
                .setLatLng([u.lat, u.lon])
                .setContent("<b>"+u.name+"</b><br>"+u.phone+"<br>"+u.last)
                .openOn(map);
        }
        box.appendChild(div);
    });
}
